import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Links extends Component {
  render() {
    return (
      <div>
        <Link to="/album/:id" />
        <Link to="/favorites" />
        <Link to="/" />
        <Link to="/profile" />
        <Link to="/profile/edit" />
        <Link to="/search" />
      </div>
    );
  }
}
export default Links;
